import React from 'react';
class Header extends React.Component{
	constructor(props){
		super(props);
	}
	render(){
		return(
			<nav className="nav">
				<li>Work</li>
				<li>Skills</li>
				<li>About</li>
				<li>Contact</li>
			</nav>
			);
	}
}
export default Header;
